import React, { useState, useEffect } from 'react';
import ContactTable from '../components/ContactsTable';
import SearchForm from '../components/SearchForm';

const Home = ({ addressBook }) =>  {

    const [contacts, set_contacts] = useState([]);
    const [query, set_query] = useState("");
    const [query_json, set_json] = useState({query : ""});
    const [edit_contact, set_edit_contact] = useState(null);

    const [first_name, set_first_name] = useState('');
    const [last_name, set_last_name] = useState('');
    const [phone, set_phone] = useState('');
    const [email, set_email] = useState('');

    useEffect(() => {
        if (query_json.query === "") {
            set_contacts(addressBook.view_all());
        } else {
            set_contacts(addressBook.search_contacts(query_json));
        }

    }, [addressBook, query_json]);

    const handle_query = (e) => {
        e.preventDefault();
        set_json({query: query});
        console.log(query_json);
    }

    const handle_edit_contact = (index) => {
        const contact_to_edit = contacts.find((contact) => contact.index === index);
        set_edit_contact(contact_to_edit);
    };

    const confirm_edit_contact = (e) => {
        e.preventDefault();

        const contact = {
            first_name: first_name,
            last_name: last_name,
            phone: phone,
            email: email,
        };

        addressBook.add_contact(contact);

        set_first_name('');
        set_last_name('');
        set_phone('');
        set_email('');
    };

    const handle_delete_contact = (index) => {
        addressBook.delete_contact(index);
        if (query === "") {
            set_contacts(addressBook.view_all());
        } else {
            set_contacts(addressBook.search_contacts(query_json));
        }
    };

    return (
        <div className="container pt-3">

            {edit_contact !== null? (
                <>
                    <div className="p-1 bg-danger text-white">
                        <h3 className="pl-2 pt-1">Edit Contact</h3>
                    </div>
                    <form onSubmit={confirm_edit_contact}>
                    <div className="mt-2 row">
                        <div className="col">
                            <label htmlFor="first-name">First Name</label>
                        </div>
                        <div className="col">
                            <label htmlFor="last-name">Email</label>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col">
                            <input
                                type="text"
                                className="form-control"
                                id="first-name"
                                placeholder="First name"
                                value={edit_contact.first_name}
                                onChange={(e) => set_first_name(e.target.value)}
                                required
                            />
                        </div>
                        <div className="col">
                            <input
                                type="text"
                                className="form-control"
                                id="last-name"
                                placeholder="Last Name"
                                value={edit_contact.last_name}
                                onChange={(e) => set_last_name(e.target.value)}
                                required
                            />
                        </div>
                    </div>
                    <div className="mt-3">
                        <label htmlFor="phone">Phone Number</label>
                        <input
                            type="tel"
                            className="form-control"
                            id="phone"
                            pattern="[0][0-9]{11}"
                            placeholder="Enter phone number"
                            value={edit_contact.phone}
                            onChange={(e) => set_phone(e.target.value)}
                            required
                        />
                    </div>
                    <div className="mt-3">
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            className="form-control"
                            id="email"
                            aria-describedby="emailHelp"
                            placeholder="Enter email"
                            value={edit_contact.email}
                            onChange={(e) => set_email(e.target.value)}
                            required
                        />
                    </div>
                    <div className="mt-3">
                        <button type="submit" className="btn btn-danger">
                            Update
                        </button>
                    </div>
                </form>
                </>
            ) : (
                <>
                    <SearchForm
                        query={query}
                        handle_query={handle_query}
                        set_query={set_query}
                    />

                    {contacts.length > 0 ? (
                        <ContactTable
                            contacts={contacts}
                            handle_edit={handle_edit_contact}
                            handle_delete={handle_delete_contact}
                        />

                    ) : (
                        <h3 className='pt-5'>No contacts found.</h3>
                    )}
                </>
            )}
        </div>
    );
};

export default Home;
